$("#btnLogin").click(function (){


  var uname = $("#loginUser").val();
  var upass = $("#loginPassword").val();

  // check if user is same a previous one
  var currUser = $.parseJSON(localStorage.getItem('currentUserDtl'));
  if (currUser !== null){
    if (uname !== currUser.name){
      localStorage.clear();
    }
  }

  var appStr = window.location.href;
  var appStrArr = appStr.split("/");
  var app_id = '';
  for(i=0; i < appStrArr.length; i++){
    if(appStrArr[i]=="Applications"){
      app_id = appStrArr[i+1];
      break;
    }
  }

  checkNavigatorIsDevice();
  setLocalStorage("ApplicationID", app_id);
  console.log("Application ID = " + app_id);

  if(uname === '' || upass === ''){
    displayError("Please enter valid username/password", 'Error');
    return;
  }

  $(".loading").show();

  var baseurl = getBaseURL();

  if ($("input[type='checkbox']")[0].checked == false){
    localStorage.removeItem('currentUserDtl');
  }

  if (localStorage.authentication_valid_until != undefined){
    var today = new Date(); var expires = new Date();
    expires = new Date(localStorage.authentication_valid_until);
    if (today <= expires){
      $(".loading").show();
      window.location.href = "home.html";
      return;
    }
  }

  if (networkStatus() === 1){

    var login_url = baseurl + "/app/alfrscosvg/auth2/services/rest/user/createtoken/?person=" + uname + "&tkn=" + upass;
    console.log(login_url);
    jQuery.support.cors = true;
    $.ajax({
          url: login_url,
          dataType: "json",
          xhrFields: {
              'withCredentials': true
          },
          crossDomain: true,
          cache: true,
          beforeSend: function( xhr ) {
            //$(".loading").show();
          },
          success: function(data, textStatus) {
            $(".loading").hide();
            console.log(data);
            //alert(data.authRequired);
            if (data.status == 'success'){
              var today = new Date(); var expires = new Date();
              expires = new Date(expires.setDate(today.getDate() + 14));
              setLocalStorage("currentUserDtl", JSON.stringify({"name": uname, "pass":  upass}));
              localStorage.setItem("authentication_valid_until", expires);  
              window.location.href = "home.html"
            }else{
              displayError("Invalid username or password. please try again.", 'Error');
            }
            //if (data.status == 'success'){
            //  localStorage.setItem("currentUserDtl", JSON.stringify({"name": uname, "pass":  upass}));
              //window.location.href = "home.html";
            //}
          },
          error: function (responseData, textStatus, errorThrown) {
            $(".loading").hide();
              //displayError("Unable to ping server, you may have to login again...", 'Error');
              console.log('Ajax Request failed. ' + errorThrown);
              //window.location.href = "index.html";
          }
      });
  } else {
    $(".loading").hide();
    alert("Please check your internet connection and try again later...");
  }
})